//         setInactiveUsers(inactiveUsers);
//       })
//       .catch((error) => {
//         console.log(error);
//       });
//   };

  return (
    <div>
      <Card>
        <div className={classes.content}>
          <h1>Inactive users</h1>
          <ul>
            {inactiveUsers.map((user) => (
              <InactiveUserItem
                key={user.id}
                id={user.id}
                name={user.name}
                surname={user.surname}
                wallet_address={user.wallet_address}
              />
            ))}
          </ul>
        </div>
      </Card>
    </div>
  );
}

export default InactiveUsers;
